import Pregunta from "./Pregunta";

const Preguntas = ({ global, setGlobal }) => {
	const cambios = global => {
		console.log("Soy cambios");
		setGlobal({ [global[0].estado]: true });
	};

	console.log("Soy global", global[0].estado);
	if (global[0].estado) {
		return <Pregunta cambios={cambios(global)} global={global} posicion={1}></Pregunta>;
	} else {
		return <Pregunta cambios={cambios} global={global} posicion={2}></Pregunta>;
	}
};

export default Preguntas;
